const Login = () =>{
  return(
    <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
    <div className="container-fluid">
    <span className="navbar-brand mb-0 h1">Feedback Portal</span>
      <Link to="/Addfeedback" className="menu"> <button className="btn btn-primary" type="submit">Add Feedback</button></Link>
    </div>
  </nav>
  )
}

export default Login;
